snippet.description:
Unique logic puzzle game inspired by sudoku and kakuro (cross sums). 
Out now for Windows, Linux and MacOS.

Steam: https://store.steampowered.com/app/865220/Puzlogic/

Kartridge: https://www.kartridge.com/game/301144

Features:
   - Unique puzzle game with familiar rules;
   - 64 handcrafted puzzles;
   - Notation on free spaces;
   - Simple drag and drop gameplay;
   - Ambient sounds and background effects;
   - Peaceful music;

